import { useEffect,useState} from "react";
import axios from 'axios';
const Main=async()=>{
    useEffect(()=>{
        const profile = axios.get(`http://localhost/profile`);
        console.log(profile);
    })
    return(<>
       console.log(profile);
    </>)

}
export default Main;
